import React, { useState,useEffect, useRef } from 'react';
import VanillaTilt from 'vanilla-tilt';


function Tilt(props) {
  const { options, ...rest } = props;
  const tilt = useRef(null);

  useEffect(() => {
    VanillaTilt.init(tilt.current, options);
  }, [options]);

  return <div ref={tilt} {...rest} />;
}



const ChatList = () => {

    // ÌåùÏóÖÏ∞ΩÏùÑ ÎÅÑÍ∏∞ ÏúÑÌï¥ ÎßåÎì† Ìï®ÏàòÏïàÏóê Îì§Ïñ¥Í∞ÄÎäî Î≥ÄÏàòÎ•º Îã¥Í∏∞ÏúÑÌïú Í≤É.-ÏûëÏóÖÏûê : Ïù¥Ï∞¨Ïö© 
    const [isVisible, setIsVisible] = useState(true);

    // Ïù∏Ìíã ÎÇ¥Ïö©ÏùÑ Î∞îÍæ∏Í∏∞ ÏúÑÌïú Ìï®Ïàò - ÏûëÏóÖÏûê : Ïù¥Ï∞¨Ïö©
    const onChange = (e) => {
        console.log(e.target);
    }
    // chatlist_popup_page_close ÏïàÏóê Îì§Ïñ¥Í∞ÄÎäî Ìï®Ïàò, ÌåùÏóÖÏ∞ΩÏùÑ ÎÅÑÍ∏∞ ÏúÑÌïú Ìï®Ïàò.-ÏûëÏóÖÏûê : Ïù¥Ï∞¨Ïö©
    const closePopup = () => {
    setIsVisible(false);
}

  // ÎØ∏Î¶¨Î≥¥Í∏∞ ÎåÄÌôî Î¶¨Ïä§Ìä∏ÏóêÏÑú Í∏∞Ïö∞Îäî Ìö®Í≥º ÎÑ£Ïñ¥Ï£ºÎäî ÏòµÏÖòÎì§. -ÏûëÏóÖÏûê : Ïù¥Ï∞¨Ïö©
  const options = {
    scale: 1.01,
    speed: 1000,
    max: 5
  };

  return (
    <div className='chatlist_bg'>

        <div className={`chatlist_popup_page ${isVisible ? '' : 'hidden'}`}>
          <button className='chatlist_popup_page_close' onClick={closePopup}>X</button>
          <div className='chatlist_popup_page_text'>
            <h4>üí¨ ÏïåÎ¶º.</h4>
            <p>Ïù¥Ï∞¨Ïö©Îãò, ÏÑ§Î†àÏù¥Îäî ÏÉàÎ°úÏö¥ Î©îÏÑ∏ÏßÄÍ∞Ä ÎèÑÏ∞©ÌñàÏñ¥Ïöî!</p>
          </div>
        </div>

        <div className="login_bgm_b">
          {/* <img className="login_bgm" src="img/main_photo.jpeg" type='img/jpeg'></img> */}
          <video className="login_bgm" autoPlay muted loop>
          <source src='videos/mainmain10.mp4' type='video/mp4' />
        </video>
        </div>
        <div className='chatlist_box'>
          <div className='chatlist_box_in'>
            <div className='chatlist_list_header'><h1>~ Ï±ÑÌåÖÏ∞Ω Î¶¨Ïä§Ìä∏ ~</h1></div>
            <hr/>
            <div className='chatlist_inner_box'>
              <Tilt options={options} className='chat_list_contents'><div className='chat_list_pro_img'></div><p className='chat_list_name'>ÍπÄÏ∂òÏûê</p><p className='chat_con_miri'>ÎåÄÌôîÎÇ¥Ïö©ÏûÖÎãàÎã§.</p></Tilt>
              <Tilt options={options} className='chat_list_contents'><div className='chat_list_pro_img'></div><p className='chat_list_name'>Ïù¥Ìñ•Ïûê</p><p className='chat_con_miri'>ÎåÄÌôîÎÇ¥Ïö©ÏûÖÎãàÎã§.</p></Tilt>
              <Tilt options={options} className='chat_list_contents'><div className='chat_list_pro_img'></div><p className='chat_list_name'>Ï∂îÏ†ïÌôî</p><p className='chat_con_miri'>ÎåÄÌôîÎÇ¥Ïö©ÏûÖÎãàÎã§.</p></Tilt>
              <Tilt options={options} className='chat_list_contents'><div className='chat_list_pro_img'></div><p className='chat_list_name'>Ïù¥ÏòÅÏûê</p><p className='chat_con_miri'>ÎåÄÌôîÎÇ¥Ïö©ÏûÖÎãàÎã§.</p></Tilt>

              </div>
          </div>
        </div>

    </div>
  )
}

export default ChatList
